import Loader from "react-spinners/ClipLoader";
import { css } from "@emotion/core";
import React from 'react';


const override = css`
  display: block;
  margin: auto;
  border-color: purple;
  top:50%;
  left:50%;
`;


export default Loader = () => {
    return(
        <div className='center'>          
        <div className="sweet-loading">
        <ClipLoader
          css={override}
          size={150}
          color={"#123abc"}
          loading={true}
        />
      </div>
      </div>);
}
